INSERT INTO `baiviet` (`id_baiviet`, `ten_baiviet`, `theloai`, `anh_chinh`, `noidung_tongquan`, `anh_1`, `anh_2`, `anh_3`, `anh_4`, `anh_5`, `noidung_1`, `noidung_2`, `noidung_3`, `noidung_4`, `noidung_5`, `ngay_tao`, `xoa`) VALUES
(3, 'Bài viết test 1 ', 2, '80ca48d69ddd233.jpg', '<p style=\"text-align: center;\">Mở đầu b&agrave;i viết</p>\r\n<p style=\"text-align: left;\">xin ch&agrave;o mn nha buổi chiều vui vẻ</p>', '855cc9c9468d015.jpg', '', '', '', '24177151909e5f3.jpg', '<p>Đ&acirc;y l&agrave; 1 b&agrave;i hướng dẫn số 1 nha&nbsp;</p>', '<p>Đ&acirc;y l&agrave; phần 2</p>', '<p>Đ&acirc;y l&agrave; phần 3</p>', '<p>Đ&acirc;y l&agrave; phần 4</p>', '<p>Đ&acirc;y l&agrave; phần 5</p>', '2025-10-14 18:33:24', 1),
(4, 'Hướng dẫn nấu phở bò tại nhà ĐẬM ĐÀ, CHUẨN VỊ ngoài hàng', 1, 'b657d78edf40495.jpg', '<p class=\"description\">Một b&aacute;t phở ngon l&agrave; sự tổng h&ograve;a của nhiều yếu tố kết hợp, đặc biệt l&agrave; phần nước d&ugrave;ng - linh hồn của b&aacute;t phở.</p>', '', '', '', '', '', '<h2><span style=\"color: #000000;\">C&aacute;ch chế biến Phở b&ograve; (nấu với g&oacute;i gia vị phở)</span></h2>\r\n<h2><span style=\"color: #000000;\">Nguy&ecirc;n liệu l&agrave;m Phở b&ograve; (nấu với g&oacute;i gia vị phở)<small>Cho 4 người</small></span></h2>\r\n<p>&nbsp;Phở&nbsp;<small>1 g&oacute;i</small>&nbsp;</p>\r\n<p>Thịt b&ograve;&nbsp;<small>500 gr</small>&nbsp;</p>\r\n<p>Xương heo&nbsp;<small>100 gr</small>&nbsp;</p>\r\n<p>Gia vị nấu phở b&ograve;&nbsp;<small>1 g&oacute;i</small>&nbsp;</p>\r\n<p>H&agrave;nh t&acirc;y&nbsp;<small>1 củ</small>&nbsp;</p>\r\n<p>H&agrave;nh t&iacute;m&nbsp;<small>4 củ</small>&nbsp;</p>\r\n<p>Gừng&nbsp;<small>1 củ</small>&nbsp;</p>\r\n<p>Đường ph&egrave;n&nbsp;<small>2 muỗng canh</small>&nbsp;</p>\r\n<p>Rau ăn phở&nbsp;<small>1 &iacute;t</small>&nbsp;</p>\r\n<p>Gia vị th&ocirc;ng dụng .&nbsp;<small>1 &iacute;t </small><em>(hạt n&ecirc;m/ đường/ bột ngọt/ muối)<img src=\"https://cdn.tgdd.vn/2021/11/CookRecipe/CookUtensilandNotes/pho-bo-nau-voi-goi-gia-vi-pho-note-1200x676.jpg\" alt=\"Nguy&ecirc;n liệu m&oacute;n ăn phở b&ograve;\" /></em></p>', '<h3>1. Sơ chế v&agrave; chần thịt</h3>\r\n<p>Bạn bắc l&ecirc;n&nbsp;bếp&nbsp;1&nbsp;nồi&nbsp;nước v&agrave; cho v&agrave;o nồi h&agrave;nh t&iacute;m đ&atilde; đập dập rồi nấu tr&ecirc;n bếp ở nhiệt độ cao.</p>\r\n<p>Khi nước s&ocirc;i, bạn cho thịt b&ograve; v&agrave; xương heo đ&atilde; sơ chế v&agrave;o v&agrave; chần khoảng 3 ph&uacute;t để loại bỏ m&ugrave;i h&ocirc;i. Sau đ&oacute;, bạn vớt thịt ra v&agrave; cho ngay v&agrave;o&nbsp;t&ocirc;&nbsp;nước lạnh.</p>\r\n<p><img src=\"https://cdn.tgdd.vn/2021/11/CookRecipe/GalleryStep/so-che-va-chan-thit-1.jpg\" /></p>\r\n<h3>2. Sơ chế c&aacute;c nguy&ecirc;n liệu kh&aacute;c</h3>\r\n<p>H&agrave;nh t&iacute;m mua về bạn lột vỏ 3 củ, sau đ&oacute; rửa sạch v&agrave; đập dập, 2 củ c&ograve;n lại th&igrave; rửa sạch v&agrave; để r&aacute;o.</p>\r\n<p>H&agrave;nh t&acirc;y cắt bỏ rễ, v&agrave; rửa sạch. Bạn rửa sạch gừng v&agrave; để r&aacute;o.</p>\r\n<p>Nướng h&agrave;nh t&acirc;y, 2 củ h&agrave;nh t&iacute;m v&agrave; gừng tr&ecirc;n bếp khoảng 2 ph&uacute;t đến khi dậy m&ugrave;i thơm.</p>\r\n<p>Bạn cho phần gia vị nấu phở b&ograve; v&agrave;o&nbsp;chảo&nbsp;v&agrave; rang tr&ecirc;n bếp ở nhiệt độ trung b&igrave;nh nhỏ trong 4 ph&uacute;t đến khi dậy m&ugrave;i thơm. Cho c&aacute;c gia vị vừa rang v&agrave;o t&uacute;i lọc c&oacute; sẵn v&agrave; cột chặt miệng t&uacute;i lại.</p>\r\n<p><img src=\"https://cdn.tgdd.vn/2021/11/CookRecipe/GalleryStep/so-che-cac-nguyen-lieu-khac-30.jpg\" /></p>\r\n<h3>3. Nấu nước d&ugrave;ng</h3>\r\n<p>Bạn cho v&agrave;o nồi 1.5 l&iacute;t nước c&ugrave;ng thịt b&ograve; v&agrave; xương heo đ&atilde; chần rồi đậy nắp lại, hầm trong 1 tiếng. Trong l&uacute;c hầm nước d&ugrave;ng, bạn thường xuy&ecirc;n mở nắp nồi v&agrave; hớt sạch bọt để nước d&ugrave;ng được trong hơn nh&eacute;!</p>\r\n<p>Khi nước s&ocirc;i, bạn cho h&agrave;nh t&acirc;y, h&agrave;nh t&iacute;m, gừng đ&atilde; nướng thơm v&agrave; t&uacute;i gia vị nấu phở đ&atilde; rang v&agrave;o nồi.</p>\r\n<p>Tiếp theo, bạn th&ecirc;m v&agrave;o nồi 2&nbsp;muỗng&nbsp;canh đường ph&egrave;n, 2 muỗng c&agrave; ph&ecirc; muối, 1.5 muỗng c&agrave; ph&ecirc; bột ngọt, 1.5 muỗng c&agrave; ph&ecirc; hạt n&ecirc;m rồi khuấy đều, n&ecirc;m nếm lại gia vị cho vừa ăn v&agrave; nắp lại 3 ph&uacute;t rồi tắt bếp l&agrave; ho&agrave;n th&agrave;nh.</p>\r\n<p><img src=\"https://cdn.tgdd.vn/2021/11/CookRecipe/GalleryStep/nau-nuoc-dung-5.jpg\" /></p>\r\n<h3>4. Ho&agrave;n th&agrave;nh</h3>\r\n<p>Bạn vớt thịt b&ograve; trong nồi nước d&ugrave;ng ra v&agrave; cắt th&agrave;nh những l&aacute;t vừa ăn.</p>\r\n<p>Sau đ&oacute;, cho b&aacute;nh phở ra t&ocirc;, xếp thịt b&ograve; l&ecirc;n tr&ecirc;n rồi chan nước d&ugrave;ng v&agrave; th&ecirc;m &iacute;t ớt cắt l&aacute;t, rau ăn phở như ng&ograve; gai, h&agrave;nh l&aacute;,...</p>\r\n<p><img src=\"https://cdn.tgdd.vn/2021/11/CookRecipe/GalleryStep/hoan-thanh-25.jpg\" /></p>\r\n<h3>5. Th&agrave;nh phẩm</h3>\r\n<p>Vậy l&agrave; t&ocirc; phở b&ograve; nấu từ g&oacute;i gia vị phở chỉ với v&agrave;i bước cơ bản đ&atilde; ho&agrave;n th&agrave;nh rồi.</p>\r\n<p>Nước d&ugrave;ng th&igrave; đậm đ&agrave;, ngọt thanh từ xương, h&agrave;nh t&iacute;m, h&agrave;nh t&acirc;y xen lẫn m&ugrave;i gừng thơm phức kết hợp với thịt b&ograve; mềm, b&eacute;o ngậy c&ugrave;ng b&aacute;nh phở mềm, dai. Tất cả tạo n&ecirc;n t&ocirc; phở b&ograve; hấp dẫn, thơm ngon kh&oacute; l&ograve;ng m&agrave; chối từ.</p>\r\n<p><img src=\"https://cdn.tgdd.vn/2021/11/CookRecipe/GalleryStep/thanh-pham-279.jpg\" /></p>', '<p><iframe style=\"width: 905px; height: 508px;\" src=\"https://www.youtube.com/embed/c9GfHgMk1ac?si=Hytve0aMjT1JUohu\" width=\"800\" height=\"449\" allowfullscreen=\"allowfullscreen\"></iframe></p>', '', '', '2025-10-15 15:53:56', 0);
