INSERT INTO `dichvu` (`id_dichvu`, `Name_dichvu`, `Gia_dichvu`, `ghichu`, `images`) VALUES
(1, 'Tiệc Đầy Tháng', 9000000, 'Tiệc đầy tháng là một trong những sự kiện quan trọng, đánh dấu cột mốc đầu tiên trong hành trình trưởng thành của bé. Tại nhà hàng, buổi tiệc được chuẩn bị chu đáo với không gian ấm cúng, trang trí theo tông màu dễ thương, nổi bật với bong bóng, hoa tươi và phông nền riêng cho gia đình chụp hình lưu niệm.\r\n\r\nThực đơn tiệc được sắp xếp đa dạng từ món khai vị, món chính đến tráng miệng, đảm bảo phù hợp cả người lớn và trẻ nhỏ. Ngoài ra, nhà hàng còn cung cấp các dịch vụ đi kèm như MC dẫn chương trình, âm nhạc nhẹ nhàng, màn pháo giấy chúc mừng, giúp buổi tiệc thêm phần trang trọng và ý nghĩa.\r\n\r\nĐội ngũ nhân viên phục vụ tận tình, chuyên nghiệp, luôn sẵn sàng hỗ trợ gia đình trong suốt buổi tiệc. Không khí tràn đầy niềm vui, tiếng cười, tạo nên những kỷ niệm khó quên cho bé và gia đình trong ngày đặc biệt này.', 'dvdaythang1.jpg;dvdaythang2.jpg;dvdaythang3.jpg'),
(2, 'Tiệc Liên Hoan', 500000, 'Tiệc liên hoan là dịp để tập thể, bạn bè hoặc đồng nghiệp cùng nhau sum vầy, nhìn lại chặng đường đã qua và chia sẻ niềm vui. Nhà hàng chuẩn bị không gian rộng rãi, thoải mái, có thể bố trí theo dạng bàn tiệc hoặc buffet tùy nhu cầu. Trang trí đơn giản, sang trọng, phù hợp cả phong cách trẻ trung năng động hoặc trang trọng lịch sự.\r\n\r\nThực đơn phong phú, đa dạng món khai vị, món chính, lẩu và tráng miệng, kết hợp cả món Việt truyền thống và món Âu hiện đại. Dịch vụ kèm theo: MC dẫn chương trình, ban nhạc, karaoke, máy chiếu – màn hình lớn để trình chiếu hình ảnh/video. Đây là lựa chọn lý tưởng cho liên hoan công ty, tất niên, họp lớp hoặc hội nhóm bạn bè.', 'dvlienhoan1.jpg;dvlienhoan2.jpg;dvlienhoan3.jpg'),
(3, 'Tiệc Báo Hỷ', 10000000, 'Tiệc báo hỷ là khoảnh khắc chia sẻ niềm hạnh phúc lứa đôi đến bạn bè, người thân. Nhà hàng mang đến không gian lãng mạn, trang trí tinh tế với hoa, nến và backdrop theo chủ đề. Thực đơn được thiết kế riêng để tạo điểm nhấn sang trọng. Các dịch vụ đi kèm như ban nhạc, MC, trình chiếu hình ảnh giúp buổi tiệc thêm phần ấm áp và ý nghĩa.', 'dvbaohy1.jpg;dvbaohy2.jpg;dvbaohy3.jpg'),
(4, 'Tiệc Sinh Nhật', 8000000, 'Tiệc sinh nhật tại nhà hàng được chuẩn bị sôi động và ấm áp với trang trí bóng bay, bánh kem, hoa và ánh sáng lung linh. Thực đơn đa dạng từ các món ăn truyền thống đến món Âu – Á, phù hợp cho nhiều lứa tuổi. Dịch vụ hỗ trợ: MC hoạt náo, âm nhạc, ảo thuật, pháo hoa lạnh và khu vực chụp hình, mang lại trải nghiệm khó quên cho chủ nhân buổi tiệc và khách mời.', 'phong1.jpg;phong2.jpg;phong3.jpg;phong4.jpg');
