INSERT INTO `monan` (`id_mon`, `name_mon`, `id_loai`, `gia_mon`, `ghichu_mon`, `images`, `tinhtrang`, `xoa`) VALUES
(77, 'Bún Mì Vàng Phúc Kiến', 29, 100000, 'Bún gạo và mì vàng Phúc Kiến dai dai hòa quyện cùng nấm mỡ béo ngậy, quyện cùng sốt XO đậm đà thơm ngon và giá đỗ thanh mát, tạo nên một món ăn vừa ngon miệng vừa bổ dưỡng.', 'c14e8b749e.jpg', 1, 0),
(78, 'Chả Giò Phô Mai', 28, 30000, '(4 cuốn) Deep Fried Chessy Roll Chả giò phô mai, bột xù, sốt mayonnaise', 'a73e66a948.jpg', 1, 0),
(79, 'Canh Củ Sen Nấm Bụng Dê', 28, 150000, 'Món canh tiềm thanh tao với củ sen giòn ngọt, đậu phộng bùi bùi, nấm tuyết và nấm bụng dê dai giòn độc lạ với vị ngon ấn tượng, hòa quyện cùng vị ngọt thanh từ rau củ, mang đến cảm giác thanh mát và bổ dưỡng.', '935d7252b1.jpg', 1, 0),
(80, 'Chả Nấm Chiên - Sốt Chua Ngọt', 29, 40000, 'Chả nấm Bếp nhà làm thơm ngon, từng lớp mềm dẻo rồi bùi bùi, đến lớp được chiên vàng giòn quyện cùng sốt chua ngọt đậm đà từ vải, nhãn, thơm, ớt chuông và hành tây, mang đến hương vị hài hòa và đầy màu sắc.', '23a7b9d56c.jpg', 1, 0),
(81, 'Chả Ram An Duyên', 29, 45000, 'An Duyen Fried Spring Roll Khoai môn, rau củ, nấm, ăn kèm cải bẹ xanh và rau sống', '6a29a37b44.jpg', 1, 0),
(82, 'Cơm Chiên Ôliu Đen Triều Sơn', 29, 45000, 'Cải cà na/Ô liu đen là nguyên liệu đặc biệt của ẩm thực người Hoa Triều Sán, kết hợp khi chiên cơm, mang đến vị ngon dậy mùi khó tả! kết hợp cùng nấm mỡ béo ngậy, được xào cùng hành lá khiến món cơm chiên trở thành \"đặc sản\" xưa này hiếm có ở Chợ Lớn', '7a102353d7.jpg', 1, 0),
(83, 'Súp Bắp Măng Tây Nấm Trùng Thảo', 28, 50000, 'Asparagus - Sweet Corn Thick Soup Bắp hạt, măng tây, nầm trùng thảo', '11f854f5d4.jpg', 1, 0),
(84, 'Gỏi Bưởi Rong Sụn', 29, 50000, 'Tossed Pomelo with Seamoss Bưởi tép, rong sụn, nấm bào ngư xé sợi, mè, rau mùi', '198701dac7.jpg', 1, 0),
(85, 'Gỏi Xoài Khô Mặn', 29, 50000, 'Tossed Green Mango with Deep Fried Fermented Bean Xoài, rau củ, tương đậu lên men chiên, rau mùi', 'b64c3a4807.jpg', 1, 0),
(86, 'Lẩu Sa Tế', 29, 100000, 'Nước lẩu sa tế cay nồng, béo ngậy kết hợp cùng đậu phộng bùi bùi và nước cốt dừa thơm lừng, nhúng kèm các loại rau nấm tươi ngon, mang đến một bữa lẩu chay ấm áp và đậm đà.', 'f0f8538562.jpg', 1, 0),
(88, 'Lẩu Thập Bảo', 29, 150000, 'Hơn 30 loại dược liệu quý giá kết hợp cùng các loại nấm, khoai môn, nhúng kèm rau và hủ tiếu/mì, tạo nên một nồi lẩu chay thanh tao, bổ dưỡng và đầy ý nghĩa.', 'fe342619f2.jpg', 1, 0),
(90, 'Miến trộn Tứ Xuyên', 29, 82000, 'Sợi miến khoai tây dai dai hòa quyện cùng vị cay nồng của sốt Tứ Xuyên làm từ xuyên tiêu, nấm kim châm và nấm mỡ, điểm xuyết cùng vị thơm tỏi phi và ớt chuông, tạo nên một món ăn kích thích vị giác. Bùng nổ khoang miệng.', 'cb52d6b622.webp', 1, 0),
(91, 'Đậu Hủ Vàng Nấm Rang Muối Kiểu Hongkong', 28, 87000, 'Món khai vị hoàn hảo với sự kết hợp hài hòa giữa đậu hũ Triều Châu, lớp vỏ dai dai đặc trưng, bên trong thơm béo mềm mại, nấm đùi gà giòn sần sật, cùng tỏi ớt vị mặn mặn, cay cay đặc trưng của muối rang kiểu HongKong.', '93336af9e2.webp', 1, 0),
(92, 'Gỏi Cuốn Mùa Xuân', 28, 72000, '(4 cuốn) Fresh Spring Roll Bún nhuyễn, hai loại đậu hũ, sốt tương đậu', '2bb1ab25d6.webp', 1, 0),
(93, 'Xà Lách Vườn Tre', 28, 50000, 'Salad Rau xà lách hỗn hợp, đậu hũ ngâm tương, hat óc chó ngào ngũ vị hương, tương xí muội', 'd91b43309a.webp', 1, 0),
(94, 'Đậu Hủ Muối Sả', 29, 45000, 'Fried Tofu with Crispy Lemongrass Đậu hũ chiên giòn, muối sả cháy giòn', '434a212f46.webp', 1, 0),
