(99, 'Lẩu Nấm Thập Cẩm', 29, 310000, 'Mushroom with Seaweed Hotpot Rong biển, táo đỏ, đậu hũ, nhúng rau nấm các loại', '534d9b5ff0.webp', 1, 0),
(100, 'Canh Cải Chua Tứ Xuyên', 29, 75000, 'ickled Mustard Green Soup in Sichuan Style Cải chua, cà chua, nấm các loại, đậu hũ, xuyên tiêu, nước hầm rau củ', '88d091df64.webp', 1, 0),
(101, 'Trà Hoa Cúc Mật Ong', 31, 20000, 'Trà hoa cúc thanh mát, kết hợp cùng vị ngọt dịu của mật ong nguyên chất, giúp an thần, giải nhiệt và hỗ trợ giấc ngủ ngon. Thích hợp cho những ai cần thư giãn sau ngày dài làm việc.\r\n\r\n', '00439b9e9e.webp', 1, 0),
(102, 'Sinh Tố Bơ Chuối', 31, 35000, 'Sinh tố bơ chuối thơm béo, bổ dưỡng, cung cấp năng lượng và chất xơ cho cơ thể. Vị ngọt tự nhiên từ hoa quả, không thêm đường, rất tốt cho sức khỏe tim mạch và hệ tiêu hóa.\r\n\r\n', 'cf79606184.jpg', 1, 0),
(103, 'Sữa Đậu Nành Tươi', 31, 19000, 'Sữa đậu nành nguyên chất tự nấu, thơm ngậy, không chất bảo quản. Nguồn protein thực vật dồi dào, phù hợp cho người ăn chay và tốt cho sức khỏe xương khớp.\r\n\r\n', '9fb542fd22.jpg', 1, 0),
(104, 'Nước Gạo Lứt Rang', 31, 32000, 'Nước gạo lứt rang thơm dịu, bổ dưỡng, giúp thanh lọc cơ thể, hỗ trợ giảm cân và ổn định huyết áp. Thích hợp uống nóng hoặc lạnh đều ngon.', '1001d91f19.webp', 1, 0),
(105, 'Trà Gừng Chanh Sả', 31, 15000, 'Sự kết hợp của gừng tươi, chanh và sả mang lại thức uống ấm nồng, giúp tăng cường sức đề kháng, phòng cảm lạnh, hỗ trợ tiêu hóa hiệu quả.', 'dc2d9e7e26.webp', 1, 0),
(106, 'Trà Đậu Đỏ', 31, 28000, 'Trà đậu đỏ thanh mát, giải độc, lợi tiểu, bổ sung khoáng chất cho cơ thể. Vị ngọt nhẹ, thích hợp cho cả người già và trẻ nhỏ.\r\n\r\n', '3d0496d8c3.jpg', 1, 0),
